package jpipe;

public class IF_ID {
	
	int cp;
	Instruccion ins;
	
	
	public IF_ID() {
		super();
		// TODO Auto-generated constructor stub
	}


	public IF_ID(int cp, Instruccion ins) {
		super();
		this.cp = cp;
		this.ins = ins;
	}


	public int getCp() {
		return cp;
	}


	public void setCp(int cp) {
		this.cp = cp;
	}


	public Instruccion getIns() {
		return ins;
	}


	public void setIns(Instruccion ins) {
		this.ins = ins;
	}
	
	

}
